import React from 'react';
import {motion} from 'framer-motion';
import { summary, leterThree } from './Animations';
import citricsLogo from '../assets/Citrics Icon.svg'

export const HRWork = () => {


    return (
    <>
        <motion.section id='about' className='summary-container' variants={summary} initial='init' animate='after'>
            <motion.div className='about-me' variants={leterThree} initial='init' animate='after'>
                <motion.h2>My Work</motion.h2>

                <motion.div>
                    <h3>Citrics</h3>
                    <img src={citricsLogo} alt='Citrics Logo' />

                </motion.div>

            </motion.div>
        </motion.section>   
    </>
    )
}
